import React from 'react';
function BrokerageSection() {
    return ( 
        <div className='container p-5'>
            <div className='row mt-5 '>
                <img src='media/images/pricingTable-1.png'/>
                <p className='fs-5 mt-4 text-center mb-5'><a href="">Calculate your costs upfront</a> using our brokerage calculator</p>
                <h3 className='mt-5 fs-4'>Charges for account opening</h3>
                <img src='media/images/pricingTable-2.png'/>
                 <h3 className='mt-5 fs-4'>Demat AMC (Annual Maintenance Charge)</h3>
                <img src='media/images/pricingTable-3.png'/>
                <p className='fs-7'>* Lower AMC is applicable only if the account qualifies as a Basic Services Demat Account (BSDA). BSDA account holders cannot hold more than one demat account. To learn more about BSDA, click here.</p>
            </div>
        </div>
     );
}

export default BrokerageSection;
